import Header from "../components/layouts/Header";
import Router from 'next/router'

const handleClickAbout = () => Router.push({pathname:'/'})
export default function About(){
    return (
        <dir>
          <Header/>
          <a onClick={()=> handleClickAbout()} >Home</a>
        </dir>
    )
}
